import './patientEnter.css'
import doctorImg from './doctor.png'

const PatientEnter = () => {


    return (
        <div className='patientEnterCont'>
            <div className='enterBoard'>

            </div>

            <img src={doctorImg} alt='doctorImg' className='doctorImg'></img>
        </div>
    );
};

export default PatientEnter;
